import cv2
import numpy

data = ""
res = []

for x in data:
    if x == "1":
        res.append(255)
    else: res.append(x)

img = numpy.array(res)
img = img.reshape(25, 25).astype('float32')
resized = cv2.resize(img, (500, 500), interpolation = cv2.INTER_AREA) # Agar gambar tidak blur saat dilihat
cv2.imwrite('Result.png', resized)